import axios from "axios"
import { useNavigate } from "react-router-dom"


export default function NavBar({setpopup,username: currentuser}){
    const navigate = useNavigate()
    async function logout(){
        let res = await axios.post('/logout')
        alert()
    }

    return(
        <header>
            <h1>TodoTheList</h1>
            <ul>
                <li>Expired</li>
                <li>Ongoing tasks</li>
                <li>Done</li>
                <li style={{backgroundColor:"green"}} onClick={() => setpopup(true)}>Add item</li>
            </ul>
            <span className="Sign-Welcome">{currentuser?
      <p>What's on your mind today, <span>{String(currentuser).charAt(0).toUpperCase() + String(currentuser).slice(1)}</span></p>:
      (currentuser? <button>Register/Login</button>: 'Loading')
    }</span>
    <button className="logout" onClick={logout}>Logout</button>
        </header>
    )
}
